import { Component } from '@angular/core';

@Component({
  selector: 'app-phone-list',
  templateUrl: './phone-list.component.html',
  styleUrls: ['./phone-list.component.scss']
})
export class PhoneListComponent {

  galaxyS22: Phone = {
    "brand": "Samsung",
    "model": "Galaxy S22",
    "price": 220.000,
    "stock": 10,
    "image": "image",
  }

  iPhone14Pro: Phone = {
    "brand": "Apple",
    "model": "iPhone 14 Pro",
    "price": "$350.000",
    "stock": "1",
    "image": "image",
  }

  mi10Lite = {
    "brand": "Xiaomi",
    "model": "Mi 10 Lite",
    "price": "$125.000",
    "stock": "19",
    "image": "image",
  }

}
